import React, { Component } from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
class BridalMakeover extends Component {

    componentDidMount() {
        window.scrollTo(0, 0)
      }

    render() {
        return (
            <div>
                <div class="card-page">
                    <div class="container">
                        <div class="row">
                            <div class="col-md-6">
                                <img src="./images/bridal-makeup-img1.png" class="img-fluid" alt=""/>
                            </div>
                            <div class="col-md-6 mt-5">
                                <img src="./images/bridal-makeup-img2.png" class="img-fluid" alt=""/>
                            </div>
                            <div class="col-md-6 mt-5">
                                <img src="./images/bridal-makeup-img3.png" class="img-fluid" alt="" />
                            </div>
                            <div class="col-md-6 mt-5">
                                <img src="./images/bridal-makeup-img4.png" class="img-fluid" alt=""/>
                            </div>
                            <div class="col-md-12 mt-5">
                                <img src="./images/bridal-makeup-img5.png" class="img-fluid" alt="" />
                            </div>
                        </div>
                    </div>
                </div>
            </div> 
            )
    }
}

export default BridalMakeover;
